/deep/ .ivu-divider-horizontal {
    margin 12px 0
}
.empty-box {
    color: #8c8c8c;
    font-size 12px;
    border-radius 0;
    background-color #eee;
    width 100%;
    border 1px solid #ddd;
    text-align center;
}

.mobile-page {
    .tip {
        font-size 12px;
        color: rgba(0, 0, 0, .45);
        margin-bottom 2px;
    }

    .advert {
        cursor pointer;

        .advertItem01 {
            width 100%;
            height 100%;
            .empty-box {
                height 366px;
                border 1px solid #ddd;
            }

            img {
                width 100%;
                height 100%;
                border 1px solid #1890ff;
            }
        }

        .advertItem02 {
            width 100%

            .item {
                width 50%;
                height 100%;

                img {
                    width 100%;
                    height 100%;
                }

                &.on{
                    img{
                        border:1px solid #1890ff!important
                    }

                   .empty-box{
                       border:1px solid #1890ff!important
                       color #1890ff
                   }
                }

                .empty-box {
                    height 189.5px;
                    border-right 1px solid #eee;
                }

                &:nth-child(2) {
                    .empty-box {
                        border-right 1px solid #ddd;
                    }
                }
            }
        }

        .advertItem03 {
            .item {
                width 33.3333%;

                .empty-box {
                    height 126.4px;
                    border-right 1px solid #eee;
                }

                &:nth-child(2) {
                    .empty-box {
                        border-right 1px solid #eee;
                    }
                }

                &:nth-child(3) {
                    .empty-box {
                        border-right 1px solid #ddd;
                    }
                }
            }
        }

        .advertItem04 {
            .item {
                width 50%;
                height 189.5px;

                .empty-box {
                    height 100%;
                }

                img {
                    width 100%;
                    height 100%;
                }

                &.on{
                    img{
                        border:1px solid #1890ff!important
                    }

                    .empty-box{
                        border:1px solid #1890ff!important
                        color #1890ff
                    }
                }

                .pic {
                    width 100%;
                    height 94.75px;

                    &.on{
                        img{
                            border:1px solid #1890ff!important
                        }

                        .empty-box{
                            border:1px solid #1890ff!important
                            color #1890ff
                        }
                    }
                }

                &:nth-child(1) {
                    .empty-box {
                        border-right 1px solid #eee;
                    }
                }

                &:nth-child(2) {
                    .pic {
                        &:nth-child(2) {
                            .empty-box {
                                border-top 1px solid #eee;
                            }
                        }
                    }
                }
            }
        }

        .advertItem05 {
            .item {
                width 25%;

                .empty-box {
                    height 94.75px;
                }

                &:nth-child(4) {
                    .empty-box {
                        border-right 1px solid #ddd;
                    }
                }

                &:nth-child(2) {
                    .empty-box {
                        border-right 1px solid #eee;
                    }
                }
            }
        }

        .advertItem06 {
            .item {
                width 50%;
                height 95px;

                img {
                    width 100%;
                    height 100%;
                }

                &.on{
                    img{
                        border:1px solid #1890ff!important
                    }

                    .empty-box{
                        border:1px solid #1890ff!important
                        color #1890ff
                    }
                }

                .empty-box {
                    height 100%;
                    border-right 1px solid #eee;
                    border-bottom 1px solid #eee;
                }

                &:nth-child(2) {
                    .empty-box {
                        border-right 1px solid #ddd;
                    }
                }

                &:nth-child(3) {
                    .empty-box {
                        border-bottom 1px solid #ddd;
                    }
                }

                &:nth-child(4) {
                    .empty-box {
                        border-right 1px solid #ddd;
                        border-bottom 1px solid #ddd;
                    }
                }
            }
        }
    }
}
